'<!DOCTYPE html>',
'<html lang="pt-br">',
'<head>',
'  <meta charset="UTF-8">',
'  <meta name="viewport" content="width=device-width, initial-scale=1.0">',
'  <title>Caixa de Texto</title>',
'  <style>',
'    .caixa-texto {',
'      width: 80%;',
'      padding: 15px;',
'      border: 2px solid #333;',
'      border-radius: 8px;',
'      background-color: #f9f9f9;',
'      box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);',
'      font-family: Arial, sans-serif;',
'      font-size: 16px;',
'      line-height: 1.6;',
'      text-align: justify;',
'      margin: 20px auto;',
'    }',
'  </style>',
'</head>',
'<body>',
'',
'  <div class="caixa-texto">',
unistr('    O sistema de cadastro de pacientes \00E9 uma aplica\00E7\00E3o desenvolvida para gerenciar informa\00E7\00F5es '),
'    de pacientes de forma eficiente e organizada. Ele permite o registro de dados essenciais, ',
unistr('    como nome, data de nascimento, CPF, endere\00E7o e hist\00F3rico m\00E9dico, armazenando essas informa\00E7\00F5es '),
unistr('    em um banco de dados seguro. Al\00E9m disso, o sistema oferece funcionalidades de edi\00E7\00E3o, '),
unistr('    possibilitando a atualiza\00E7\00E3o dos dados de um paciente sempre que necess\00E1rio, e de busca, '),
unistr('    permitindo localizar rapidamente um paciente espec\00EDfico por meio de crit\00E9rios como CPF ou nome. '),
unistr('    O objetivo \00E9 facilitar o controle e o acesso \00E0s informa\00E7\00F5es, garantindo praticidade para profissionais '),
unistr('    de sa\00FAde ou administradores em cl\00EDnicas, hospitais ou consult\00F3rios.'),
'  </div>',
'',
'</body>',
'</html>',
''))
